import { useState } from "react";
import { colors } from "../locales/colors";
import { LogoImg } from "../locales/images/logo";
import { pl } from "../locales/languages/pl";
import { Button, LoginButton } from "../styles/Buttons";
import { Constants } from "../styles/Constants";
import {
  HeaderBox,
  LoginBox,
  LogoBox,
  TitleTxt,
  LogoSubBox,
  SearchHiddenHandle,
} from "../styles/Header";
import {
  MainTitleText,
  IrishText,
  SerifTextS,
  SerifText,
} from "../styles/TextStyles";
import { Search } from "./Search";

export const Header = ({ filter, setFilter }: any) => {
  const [isOpen, setIsOpen] = useState(false);
  return (
    <HeaderBox>
      <Search filter={filter} setFilter={setFilter}></Search>
      <LogoBox>
        <LogoSubBox onClick={() => console.log("SIKKKKKE")}>
          <LogoImg />
        </LogoSubBox>
      </LogoBox>
      <TitleTxt>
        <MainTitleText>{pl.title}</MainTitleText>
      </TitleTxt>
      <LoginBox>
        <LoginButton theme={colors.filterBtn}>
          <SerifText style={{ userSelect: "none" }}>
            {pl.header.login}
          </SerifText>
        </LoginButton>
        <LoginButton theme={colors.filterBtn}>
          <SerifText style={{ userSelect: "none" }}>{pl.header.list}</SerifText>
        </LoginButton>
      </LoginBox>
      <SearchHiddenHandle
        theme={isOpen}
        onMouseEnter={() => setIsOpen(true)}
        onMouseEnter={() => setIsOpen(false)}
      />
    </HeaderBox>
  );
};
